ight: bold; '>X-Axis Label<\/div>",n5m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>X-Axis Values Font Color <i>(click on the box to pick another colour)<\/i><\/div>",o5m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>X-Axis Values Font Size<\/div>",m5m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>X-Axis Values Font Style<\/div>",B4m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>Y-Axis Label Font Color <i>(click on the box to pick another colour)<\/i><\/div>",C4m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>Y-Axis Label Font Size<\/div>",D4m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>Y-Axis Label Font Style<\/div>",A4m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>Y-Axis Label<\/div>",F4m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>Y-Axis Values Font Color <i>(click on the box to pick another colour)<\/i><\/div>",G4m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>Y-Axis Values Font Size<\/div>",E4m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>Y-Axis Values Font Style<\/div>",U2m="<div style='font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '>Years<\/div>",bYo="<div style='font-family: sans-serif; color: #1D4589;'><b>Auto-Update This Object Up To:<\/b><\/div>",cYo="<div style='font-family: sans-serif; color: #1D4589;'><i style='font-size: 8pt;'>Workstation objects, such as charts and tables, automatically update themselves when their datasource changes. This feature limit the auto-update up to a cetain date. e.g. Setting the date to July 1st 2011 means that any data beyond July 1st 2011 will not be shown by charts/tables using this feature.<\/i><\/div>",H0m="<div style='font-family: sans-serif; color: #CA1616; font-size: 8pt; font-weight: bold; '>Labels Frequency<\/div",B$o="<div style='font-family: sans-serif; font-size: 28pt; color: #FFFFFF; background-color: ",t_o="<div style='font-family: sans-serif; font-size: 28pt; color: #FFFFFF; background-color: #CA1616;'>Tools Gallery<\/div>",r_o="<div style='font-family: sans-serif; font-size: 28pt; color: #FFFFFF; background-color: #CA1616;'>Welcome!<\/div>",Beo="<div style='font-family: sans-serif; font-size: 7pt; color: #1D4589;'><font color='#CA1616'><b>Step By Step Guide: <\/b><\/font>By selecting a dimension from the <i>Available Dimension<\/i> box the associated values appear in the <i>Available Values<\/i> box. Click on the values you want to plot on the Y-Axis of the chart. If a Date Dimension has been selected, then the additional date options will be enabled:<br>&nbsp;&nbsp;&nbsp;* aggregate the dates<br>&nbsp;&nbsp;&nbsp;* limit the dates to specific months or years<br>&nbsp;&nbsp;&nbsp;* use the most recent data - which keeps a saved chart always refreshed with the latest data<br>After the selections are complete, the chart can be viewed by clicking on the <b>View Chart<\/b> button.<\/div>",q2n="<div style='font-family: sans-serif; font-size: 7pt; color: #1D4589;'><font color='#CA1616'><b>Step By Step Guide: <\/b><\/font>Here you can  apply additional conditions to your chart. These conditions can only be applied to those dimensions and values of the dataset which have not been selected as the X-Axis or Y-Axis selection (<i>click on <b>Values on X<\/b> and <b>Values on Y<\/b> buttons to modify these<\/i>).<\/div>  ",wlo="<div style='font-family: sans-serif; font-size: 7pt; color: #1D4589;'><font color='#CA1616'><b>Step By Step Guide: <\/b><\/font>Here you can add additional datasets to your chart, or to change the type of chart you are using (<i>select line or bar from the drop down menu next to the dataset<\/i>). For charts with multiple datasets, you can also select/de-select the ones you want to use for your chart.<\/div>",Lao="<div style='font-family: sans-serif; font-size: 7pt; color: #1D4589;'><font color='#CA1616'><b>Step By Step Guide: <\/b><\/font>Here you can customize your charts: the <b>General Settings<\/b> tab, refers to general customization such as the chart's title, legend, size as well as the X-Axis values and labels. The second tab is for the Y-Axis. If you have selected multiple datasets for your chart, then additional tabs will appear. At any stage of the customization you will be able to view the modified chart by clicking on <b>View Chart<\/b> button.<\/div>",Iao="<div style='font-family: sans-serif; font-size: 7pt; color: #1D4589;'><font color='#CA1616'><b>Step By Step Guide: <\/b><\/font>Select one of the available Chart Types below to start creating your chart. If you need a Quick Start Guide or more detailed information about this tool please click on the <b>Manual<\/b> button in the toolbar.<\/div>  ",Oao="<div style='font-family: sans-serif; font-size: 7pt; color: #1D4589;'><font color='#CA1616'><b>Step By Step Guide: <\/b><\/font>The final chart can be exported (<i>as an image or iframe<\/i>), saved (<i>if you are logged in<\/i>) or cloned (<i>copied<\/i>).The chart can be further enhanced/modified by:<br>&nbsp;&nbsp;&nbsp;* the addition of more datasets (<b>Data Source<\/b> button)<br>&nbsp;&nbsp;&nbsp;* formatting the chart (<i>e.g. color, size, legend, minimum and maximum values<\/i>) through the <b>Look&Feel<\/b> button<br>&nbsp;&nbsp;&nbsp;* modifying the values on the X and Y axes (<b>Values on X<\/b> and <b>Values on Y<\/b> buttons)<br>&nbsp;&nbsp;&nbsp;* filtering the chart's data (<b>Filters<\/b> button)<br>&nbsp;&nbsp;&nbsp;* performing basic statistical analyses (<b>Statistical Analysis<\/b> button)<\/div> ",nlo="<div style='font-family: sans-serif; font-size: 7pt; color: #1D4589;'><font color='#CA1616'><b>Step By Step Guide: <\/b><\/font>You can apply a statistical function to your datasource and plot the result, e.g. aggregation functions.<\/div>",dmo="<div style='font-family: sans-serif; font-size: 7pt; color: #1D4589;'><font color='#CA1616'><b>Step By Step Guide: <\/b><\/font>You can change the default X-Axis setting of the <i>Date<\/i> Dimension here. The process is the same as for the Y-Axis Selection.<\/div>",T$o="<div style='font-family: sans-serif; font-size: 8pt; color: #FFFFFF; font-variant: small-caps; font-weight: bold;'>Category<\/div>",L$o="<div style='font-family: sans-serif; font-size: 8pt; color: #FFFFFF; font-variant: small-caps; font-weight: bold;'>Free Text<\/div>",V$o="<div style='font-family: sans-serif; font-size: 8pt; color: #FFFFFF; font-variant: small-caps; font-weight: bold;'>From Date<\/div>",R$o="<div style='font-family: sans-serif; font-size: 8pt; color: #FFFFFF; font-variant: small-caps; font-weight: bold;'>Region/Geography<\/div>",P$o="<div style='font-family: sans-serif; font-size: 8pt; color: #FFFFFF; font-variant: small-caps; font-weight: bold;'>Resource Type<\/div>",N$o="<div style='font-family: sans-serif; font-size: 8pt; color: #FFFFFF; font-variant: small-caps; font-weight: bold;'>Source<\/div>",wTo="<div style='font-family: sans-serif; font-size: 8pt; color: #FFFFFF; font-variant: small-caps; font-weight: bold;'>Syntax of R<\/div>",X$o="<div style='font-family: sans-serif; font-size: 8pt; color: #FFFFFF; font-variant: small-caps; font-weight: bold;'>To Date<\/div>",C1m="<div style='font-family: sans-serif; font-size: 9pt; color: #1D4589;'><H1>Welcome to the Chart Designer Tool!<\/H1><br>The <b>Chart Designer Tool<\/b> will allow you to create your own charts from existing datasets. Saved charts will be automatically refreshed whenever the datasets are updated and all saved charts can be added to external websites/documents.<br><br><u><b>Quick Start<\/b><\/u><br><br><div style='border: 1px solid #1D4589;'>After selecting the type of chart, the Resource Explorer Dataset Selection window will open. From here you can select the datasets you want to use. Once the datasets have been selected, the  Values on Y (<img src='images/checklist.ico'>) screen will be displayed and the chart's Y-Axis dimensions can be decided upon. If you click on the <b>Values on X<\/b> (<img src='images/checklist.ico'>) button, you will see that the chart's X-Axis has already been set, by default, to the <i>Date<\/i> Dimension (this can be altered if desired). After the X and Y Dimensions have been set, just click on the <b>View Chart<\/b> (<img src='images/chart_bar.png'>) button to see your chart. All the design settings of a chart can be modified by clicking on the <b>Look&Feel<\/b> (<img src='images/sld.png'>) button.<\/div><br><u><b>Values on Y<\/b><\/u><br><br>By selecting a dimension from the <i>Available Dimension<\/i> box the associated values appear in the <i>Available Values<\/i> box. Click on the values you want to plot on the Y-Axis of the chart. If a <i>Date<\/i> Dimension has been selected, then the additional date options will be enabled:<br>&nbsp;&nbsp;&nbsp;* aggregate the dates<br>&nbsp;&nbsp;&nbsp;* limit the dates to specific months or years<br>&nbsp;&nbsp;&nbsp;* use the most recent data - which keeps a saved chart always refreshed with the latest data<br>After the selections are complete, the chart can be viewed by clicking on the <b>View Chart<\/b> (<img src='images/chart_bar.png'>) button.<br><br><u><b>Values on X<\/b><\/u><br><br>You can change the default X-Axis setting of the <i>Date<\/i> Dimension here. The process is the same as for the Y-Axis Selection.<br><br><u><b>Your Chart<\/b><\/u><br><br>The final chart can be exported (<i>as an image or iframe<\/i>), saved (<i>if you are logged in<\/i>) or cloned (<i>copied<\/i>).<br>The chart can be further enhanced/modified by:<br>&nbsp;&nbsp;&nbsp;* the addition of more datasets (<b>Data Source<\/b> button)<br>&nbsp;&nbsp;&nbsp;* formatting the chart (<i>e.g. color, size, legend, minimum and maximum values<\/i>) through the <b>Look&Feel<\/b> button<br>&nbsp;&nbsp;&nbsp;* modifying the values on the X and Y axes (<b>Values on X<\/b> and <b>Values on Y<\/b> buttons)<br>&nbsp;&nbsp;&nbsp;* filtering the chart's data (<b>Filters<\/b> button)<br>&nbsp;&nbsp;&nbsp;* performing basic statistical analyses (<b>Statistical Analysis<\/b> button)<\/div>",Kzn="<div style='font-family: sans-serif; font-size: 9pt; color: #1D4589;'><b>Welcome to the FAOStat Importer!<\/b><br><br>Use the <i>Data<\/i> (<img src='images/database.png'>) tab to create your filter to query the FAOStat database.<br><br>Once your filter is complete<\/div>",iwn="<div style='font-family: sans-serif; font-size: 9pt; color: #1D4589;'><b>Welcome to the Report Designer!<\/b><br><br>To create a new report please click either on <i>Add New Portrait Page<\/i> (<img src='images/portrait.png'>) or <i>Add New Landscape Page<\/i> (<img src='images/landscape.png'>) button in the toolbar. A new tab will display for every page.<br><br>A grid now appears on your left. Click on the <i>Add New Box<\/i> (<img src='images/add.png'>) in the tab menu to enable the grid to become interactive. Now on the grid, select 2 check-boxes. The first selection (click 1) will represent the top-left hand corner of your box and the second (click 2) the bottom-right hand corner.<br><br>Now, to fill the box with the desired Workstation resource, select the Resource Type from the drop-down on your right, then click the <i>Pick a Resource<\/i> (<img src='re-images/search.png'>) icon to open the Resource Explorer. Select your resource from the Resource Explorer.<br><br>More boxes and/or pages can be added, as required. Click on the <i>Create Report<\/i> (<img src='menu-images/wand.png'>) on the toolbar to generate a PDF.<br><br>Click on the <i>Save<\/i> (<img src='images/save.gif'>) icon, at any point, to save your design.<\/div>",aZo="<div style='font-family: sans-serif; font-weight: bold;'>Available Formats<\/div>",eZo="<div style='font-family: sans-serif; font-weight: bold;'>Number of Pages<\/div>",dZo="<div style='font-family: sans-serif; font-weight: bold;'>Page Height <i>(mm)<\/i><\/div>",cZo="<div style='font-family: sans-serif; font-weight: bold;'>Page Width <i>(mm)<\/i><\/div>",LGo="<div style='font-size: ",ZNm="<div style='font-size: 10pt; font-family: sans-serif; background-color: #D0DDED; font-weight: bold;'>",aOm="<div style='font-size: 8pt; font-family: sans-serif; background-color: #C0C0C0;'>",_Nm="<div style='font-size: 8pt; font-family: sans-serif; background-color: #D0DDED;'>",l_o="<div style='font-size: 8pt; font-family: sans-serif; text-align: left; color: #000000; '><img src='",MKn="<div style='font-weight:bold; color:green'> ",fOm="<div style='font-weight:bold;'>",xvm="<div style='overflow: hidden;'>",yvm="<div style='overflow: scroll;'>",zGo="<div style='text-align: right; font-family: sans-serif; color: #1D4589; font-size: 8pt; font-weight: bold; '><i>",Uun="<div width='10px' height='10px' style='background-color: ",Vim='<div><table class={0} cellpadding=0 cellspacing=0><tbody>',HXo='<div>MARK<\/div>',m2n="<em>Powered by the <a STYLE='text-decoration:none' target='_blank' href='http://lprapp08.fao.org/fenix-portal/'>Workstation (FENIX)<\/a> under the EC-FAO Food Security Information for Decision Making Programme; jointly developed with the FAO Land and Water Division<\/em>",Tdn="<font color='",TDn="<font color='#15428B'>",fHo="<font color='#1D4589'>Multidimensional Tables are used to create aggregations of raw data. Please select from the menu above one of the available aggregation functions to be applied to the datasource you have selected.<\/font>",pHo="<font color='#1D4589'>Please select a dataset from the Resource Explorer by clicking on the 'Add Dataset' button. Then you will be able to select dimensions and values contained in this dataset to create your multidimensional table.<\/font>",rzn="<font color='#1D4589'>Use this interface to create FAOStat coding systems to be used by the Workstation.<\/font>",xFn="<font color='#CA1616'>",WEo="<font color='#CA1616'><b>Suggestions: <\/b><\/font><font color='#15428B'>",iTo="<font color='#FFFFFF'> Input:<br><br>&nbsp;&nbsp;&nbsp;mac_input<br><br>Output: on mac_date<br><br>&nbsp;&nbsp;&nbsp;mac_output<br><br><hr><\/font>",Nun="<font color='green'>",Pun="<font color='green'>Click to view the dataset as a <\/font>",FEn="<font color='green'>Your image has been uploaded. You can now use it within the Workstation.<\/font>",Run="<font color='green'>or<\/font>",n9m="<font color='red'>",vMo="<font color='red'> <b>",Sun="<font size='2pt' color='blue'>chart<\/font>",Qun="<font size='2pt' color='blue'>table<\/font>",qro="<font style='color: black;'>YOUR MULTI-COLUMNS TEXT HERE<\/font>",Jjn='<h1>Image Viewer<\/h1>',Qro='<hr />',Nkn='<hr/>',JXm='<hr>',uno="<html><head><title>FENIX Multidimensional Tables<\/title><style type='text/css'>.manual {font-family: sans-serif;font-size: 8pt;color: #1D4589;text-align: justify;}.manual.title {font-weight: bold;font-size: 12pt;font-variant: small-caps;}.manual.title.sub {font-size: 9pt;text-decoration: underline;}.manualSummary {font-family: sans-serif;font-size: 8pt;color: #1D4589;width: 150px;font-variant: small-caps;}A:link {text-decoration: none; color: #1D4589; font-variant: small-caps;}A:visited {text-decoration: none; color: #1D4589; font-variant: small-caps;}A:active {text-decoration: none; color: #1D4589; font-variant: small-caps;}A:hover {text-decoration: underline; color: #1D4589; font-variant: small-caps;}<\/style><\/head><body><div class='manual title'>FENIX Workstation Multidimensional Table Tool<\/div><br><div class='manual'>This tool aggregates data stored in FENIX Workstation datasets to create multidimensional (<i>pivot<\/i>) tables. To create a multidimensional table the user defines an aggregation function and a set of dimensions that become the columns and the rows of the final table. For each column-row intersection FENIX Workstation queries the dataset to retrieve the appropriate values and aggregates them according to the function selected by the user. A maximum of four dimensions (<i>rows, columns, sub-rows and sub-columns<\/i>) can be selected to generate pivot table. The final output can be customized (<i>colors, fonts, size<\/i>) and it can be exported to Excel or embedded in web sites.<\/div><br><table style=\"border: 1px solid #1D4589; background-color: #D0DDED; color: #1D4589;\"><tr><td align='center' class='manualSummary'><b>Contents<\/b><\/td><\/tr><tr><td class='manualSummary'><a href='#quickstart'>1 Quick Start<\/a><\/td><\/tr><tr><td class='manualSummary'><a href='#structure'>2 Structure of the Tool<\/a><\/td><\/tr><tr><td class='manualSummary'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a href='#controller'>2.1 The Controller<\/a><\/td><\/tr><tr><td class='manualSummary'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a href='#toolbar'>2.2 The Toolbar<\/a><\/td><\/tr><\/tr><\/table><br><div class='manual title sub'><a name='quickstart'>Quick Start<\/a><\/div><br><div class='manual'>This section guides the user in the creation of a basic table. To know more about the tool's functionalities please complete the reading of this manual. There are five easy steps to follow to create a multidimensional table:<br><br><b>1) <\/b>In the <i>Datasource<\/i> section of the <a href='#controller'>Controller<\/a> click on the <i>Add Dataset<\/i> button. The Resource Explorer is shown to the user that can use it to browse available datasets. Double-click on the dataset of interest to select it to create the pivot table<br><br><b>2) <\/b>In a pivot table data is shown as the intersection of the variables listed as column and row headers (<i>e.g. commodity VS market<\/i>). This intersection may contain more than a value, thus it is necessary to define an aggregation function for these values. In the <i>Aggregation Function<\/i> section user selects the function that is applied to create the table. Function is selected by clicking on it, FENIX Workstation use the highlghted entry in the list to perform the aggregation.<br><br><b>3) <\/b>Click on the <i>Columns<\/i> section to expand it. The <i>Dimensions<\/i> list contains all the dimensions of the selected datasource, except the ones that contain numeric values. When a dimension is selected, the <i>Values<\/i> box shows all the available values of the selected dimension. All the highlighted entries in the <i>Values<\/i> box are used as column headers in the output table. By default, all the values are pre-selected. To select/de-select more than a value in the list, hold CTRL and click on the values of interest. To select/de-select a range of values, click on the first value, hold SHIFT and click on the last value of the range.<br><br><b>4) <\/b>Repeat the procedure of point 3 for the <i>Rows<\/i> section.<br><br><b>5) <\/b>Click on the <i>Create Multidimensional Table<\/i> in the <a href='#toolbar'>Toolbar<\/a> to generate the pivot table.<\/div><br><div class='manual title sub'><a name='structure'>Structure of the Tool<\/a><\/div><br><div class='manual'>All the functionalities of this tool are accessible through: the Controller (on the left part of this window) and the Toolbar (on the top).<\/div><br><div class='manual title sub'><a name='controller'>The Controller<\/a><\/div><br><div class='manual'>The left part of this window is the Controller, which is divided in 9 sections: <i>Datasource<\/i>, <i>Aggregation Function<\/i>, <i>Columns<\/i>, <i>Rows<\/i>, <i>Sub-Columns<\/i>, <i>Sub-Rows<\/i>, <i>Dimension To Plot<\/i>, <i>Settings<\/i> and <i>Format<\/i>. Only four of these sections are needed to create a basic table: <i>Datasource<\/i>, <i>Aggregation Function<\/i>, <i>Rows<\/i> and <i>Columns<\/i>; all the remaining ones are used to create tables with more than two dimensions (<i>up to four<\/i>) or to customize the output. Each section can be expanded to show its contents by clicking on its title or on the + icon beside it.<\/div><br><div class='manual title sub'><a name='toolbar'>The Toolbar<\/a><\/div><br><div class='manual'>On the top of this guide there is a toolbar holding a series of icons to export the final output and the '<i>Create Multidimensional Table<\/i>' button. This button is used to create or refresh the table evry time the user changes something in the settings or in the table's definition.<\/div><br><\/body><\/html>",Z_o='<i>',JEn='<i>conflict data that may already exist in the Workstation<\/i>',XDn='<i>eventual conflict data already in the DB<\/i>',ZDn='<i>is the delimiter for this code list<\/i>',KEn='<i>is the delimiter for this dataset<\/i>',fGn='<i>move the slider to change the time interval<\/i>',AXo='<iframe',Wqm='<iframe id="',YCm="<iframe src=\"javascript:''\" name='",iSm="<iframe src='",qWm="<iframe src='../earlyWarning/CountryInCrisisLatestDate.html' style='height:13px;width:100%' scrolling=no marginheight='0px' frameborder=no><\/iframe><br><br> Click links to preview the tables and map images",zXo='<img',hxm='<img src="gxt/images/default/shared/clear.gif" class="x-ftree-joint ',Fuo='<img src="{layerStyle}" title="{layerDesc}"/> ',tDm="<img src='",Njn="<img src='../imageRepository/",kum="<label for={8} style='{2};{7}' class=x-form-item-label>{1}{4}<\/label>",Uom="<li class='{style}' id={id} role='tab' tabindex='0'><a class=x-tab-strip-close role='presentation'><\/a>",Rom="<li class=x-tab-edge role='presentation'><\/li>",otm='<li><b>',Vyo='<ogc:And>',Uyo='<ogc:Filter>',Zyo='<ogc:Literal>',gzo='<ogc:PropertyIsEqualTo>',czo='<ogc:PropertyIsGreaterThan>',ezo='<ogc:PropertyIsGreaterThanOrEqualTo>',Wyo='<ogc:PropertyIsLessThan>',azo='<ogc:PropertyIsLessThanOrEqualTo>',Xyo='<ogc:PropertyName>',RVo='<p>',QVo='<p\\s*.*>',Xxo='<pre>',lbn='<pre><\/pre>',Duo='<span  title="{title}">',Wom="<span class='x-tab-strip-inner' role='presentation'><span class='x-tab-strip-text {textStyle} {iconStyle}'>{text}<\/span><\/span>",dvm='<span class=x-menu-sep
